import React from "react";
import { useState, useEffect } from "react";

export default function Movies() {
  const [movies, setMovies] = useState([]);

  // mounted
  useEffect(() => {
    fetch("https://yts.mx/api/v2/list_movies.json")
    .then((res) => res.json())
    .then((json) => console.log(json));
  })
  return (
    <div>Movies</div>
  )
}
